import React from 'react';
import Jsicon from './Images/icons8-javascript-48.png';

const Projects = () => {
  return (
    <div className="bg-color set">
      <div className="flex">
        <div>
          <img src={Jsicon} />
        </div>
        <div>bootstrap</div>
        <div>css</div>
        <div>html</div>
      </div>
    </div>
  );
};

export default Projects;
